import { RadixParticle, RadixEUID } from '../RadixAtomModel';
export default abstract class RadixAtom extends RadixParticle {
    particles: Array<RadixParticle>;
    temporal_proof: {
        atom_id: string;
        serializer: number;
        version: number;
        vertices: Array<any>;
    };
    hid: RadixEUID;
    timestamps: {
        default: number;
    };
    payload: any;
    constructor(json?: object);
    static compare: (a: RadixAtom, b: RadixAtom) => number;
}
